CREATE DATABASE PE_DBI202_Su2024_B5
GO

USE PE_DBI202_Su2024_B5
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

---------------------------- Create table ----------------------------------
-- Create Customers Table
CREATE TABLE Customers (
    CustomerID INT PRIMARY KEY IDENTITY(1,1),
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Email VARCHAR(100) UNIQUE NOT NULL,
    PhoneNumber VARCHAR(15),
    LicenseNumber VARCHAR(50) UNIQUE NOT NULL,
    Address VARCHAR(200)
);

-- Create CarCategories Table
CREATE TABLE CarCategories (
    CategoryID INT PRIMARY KEY IDENTITY(1,1),
    CategoryName VARCHAR(50) NOT NULL unique,
	RentalPricePerDay decimal(10,2) 
);

-- Create RentalLocations Table
CREATE TABLE RentalLocations (
    RentalLocationID INT PRIMARY KEY IDENTITY(1,1),
    LocationName VARCHAR(100) NOT NULL unique,
    Address VARCHAR(200),
    PhoneNumber VARCHAR(15)
);

-- Create Cars Table
CREATE TABLE Cars (
    CarID INT PRIMARY KEY IDENTITY(1,1),
    Maker VARCHAR(50) NOT NULL,
    Model VARCHAR(50) NOT NULL,
    Year INT NOT NULL,
    LicensePlate VARCHAR(20) UNIQUE NOT NULL,
    CategoryID INT FOREIGN KEY REFERENCES CarCategories(CategoryID),
    CurrentLocationID INT FOREIGN KEY REFERENCES RentalLocations(RentalLocationID),
    Status VARCHAR(20) NOT NULL
    CONSTRAINT chk_Status CHECK (Status IN ('Available', 'Rented', 'Maintenance'))
);

-- Create Employees Table
CREATE TABLE Employees (
    EmployeeID INT PRIMARY KEY IDENTITY(1,1),
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    Email VARCHAR(100) UNIQUE NOT NULL,
    PhoneNumber VARCHAR(15),
    Position VARCHAR(50),
    HireDate DATE NOT NULL
);

-- Create Rentals Table with ReturnLocationID
CREATE TABLE Rentals (
    RentalID INT PRIMARY KEY IDENTITY(1,1),
    CustomerID INT FOREIGN KEY REFERENCES Customers(CustomerID),
    CarID INT FOREIGN KEY REFERENCES Cars(CarID),
    EmployeeID INT FOREIGN KEY REFERENCES Employees(EmployeeID),
    RentalDate DATE NOT NULL,
    ReturnDate DATE,
    TotalAmount DECIMAL(10, 2),
    RentalLocationID INT FOREIGN KEY REFERENCES RentalLocations(RentalLocationID),
    ReturnLocationID INT FOREIGN KEY REFERENCES RentalLocations(RentalLocationID),
    CONSTRAINT chk_ReturnDate CHECK (ReturnDate IS NULL OR ReturnDate >= RentalDate)
);

